import React, {Component} from 'react';

class Header extends Component {

    state={
      headerList:['Featured', 'Blogs', 'Bloggers', 'Search']
    };

    componentDidMount() {

    }

    render() {
        const {headerList} = this.state;

        const headerAnchor = headerList.map((item, index) => {
           return (
               <div style={styles.headerAnchorItems}>
                   {item}
               </div>
           )
        });

        return (
            <div style={styles.headerContainer}>
                <div style={{display: 'flex', flexDirection: 'row'}}>
                    <span>
                        LOGO
                    </span>
                    <div style={styles.headerAnchorContainer}>
                        {headerAnchor}
                    </div>
                </div>
                <div>

                </div>
            </div>
        )
    }
}

const styles= {
    headerContainer: {
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'center',
        padding: '10px 40px'
    },
    headerAnchorContainer: {
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'center',
        padding: '0 10px'
    },
    headerAnchorItems: {
        padding: '0 10px'
    }
};

export default Header;
